const Visual = props => {

const {temp,err} = props.weather 
let img_src = {sun:'https://upload.wikimedia.org/wikipedia/commons/2/2d/Soleil_wiki.jpg'};
let content = null;
console.log('temp', {temp})
if(temp>20){
    content = (
        <div> 
            <img src={img_src.sun} alt="sun" height="42" width="42"/>
        </div>
    )

}

else if (err) {
    content = (
        <div> 
        </div>
    )

}



return (
        <div className="Visual">
            {err ? `picture not available` 
            :content}
        </div>


  );
}

export default Visual;
